import styles from "./HeroContainer.scss";

const HeroContainer = () => {
  return (
    <div className="hero-slide">
      <div>
        <img src="https://images.unsplash.com/photo-1642920581947-177d775c0c12?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D&auto=format&fit=crop&w=2074&q=80" />
      </div>
      <div>
        <img src="https://images.unsplash.com/photo-1642920581947-177d775c0c12?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D&auto=format&fit=crop&w=2074&q=80" />
      </div>
      <div>
        <img src="https://images.unsplash.com/photo-1642920581947-177d775c0c12?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D&auto=format&fit=crop&w=2074&q=80" />
      </div>
      <div>
        <img src="https://images.unsplash.com/photo-1642920581947-177d775c0c12?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D&auto=format&fit=crop&w=2074&q=80" />
